public static float parseFloat(@Nullable String str) {
        if (str == null || str.isEmpty()) {
            return Float.NaN;
        } else {
            try {
                return Float.parseFloat(str);
            } catch (NumberFormatException e) {
                Exceptions.report(e);
                return Float.NaN;
            }
        }
    }
